import {inject} from 'aurelia-framework';
import {HttpClient,json} from 'aurelia-fetch-client';
import 'fetch';
import moment from 'moment';



@inject(HttpClient)
export class PDFService{


  	constructor(http) {
  	    http.configure(config => {
  	      config
  	        .useStandardConfiguration();
  	    });
  	    this.http = http;
    }

    attached () {

    }

    generatePDF (nodeList, name, surname, dates, search, filter, headerText) {

      var doc = new jsPDF("landscape");

      // Setup //
      doc.setFont('sans-serif');
      doc.setFontSize('10');

      // Header //
      var yGap = 10;
      var pageHeight = doc.internal.pageSize.height;
      var pageCount = 1;
      var pageKeepOut = 10;  
      var margin = 5;
      var y = pageKeepOut;  
      var x = margin;
      console.log("Doc page height: " + pageHeight);
      //doc.addImage("/assets/PashionRMPlainBlack.png", 'PNG', 10,10, 131,22);
      doc.addImage("data:image/png;base64,", 
        'PNG', x,y, 65,11);

      y = y + 20;
      doc.text("Request Report", x, y);

      y = y + yGap;     
      var today = new Date();

      today = moment(today).format('DD-MMM-YYYY');

      doc.text("Created: " + today, x, y);

      y = y + yGap;
      doc.text("For: " + name + " " + surname, x, y);

      if (dates) {
        y = y + yGap;
        doc.text(dates, x, y);
      }

      if (search) {
        y = y + yGap;
        doc.text(search, x, y);
      }

      if (filter) {
        y = y + yGap;
        doc.text(filter, x, y);
      }

      y = y + yGap;
      doc.text(headerText, x, y);

      // Rows //
      var i = 0;
      var rowText = '';
      for (i = 0; i < nodeList.length; i++) {

        // New Page?
        if (y >= (pageHeight * pageCount - pageKeepOut)) {
          // New page
          doc.addPage(); // RM better math here
          pageCount = pageCount + 1;
          // set y to top of page
          y = pageKeepOut; // (pageCount -1)  * pageHeight + pageKeepOut;
        }
        rowText = nodeList[i].outerText;
        rowText = rowText.replace(/(\r\n|\n|\r)/gm,""); // remove line feeds
        rowText = rowText.replace(/\./g,''); // remove dots
        y = y + yGap;
        doc.text(rowText, margin, y);
      }
      //doc.fromHTML(text,15,15,{'width': 180});
      doc.save('PashionRequestReport_' + today + '.pdf');
    }

    	

}

